function stopSound(number) {
    if (sounds[number]) {
        sounds[number].stop();
    }
}
function playSound(number, overlapping = false) {

    if(sounds[number]){
      var snd = new Audio();
      if( overlapping ) {
          snd = sounds[number].cloneNode();
          snd.play();
       }
       else { sounds[number].play(); }
    }
      //sounds[number].play();
      snd = undefined;
}

function playRandomSound( overlapping = false ) { playSound(Math.floor(Math.random() * Math.floor(window.sounds.length)), overlapping); }

//Keyboard support
window.onkeydown = function(event){
	event = event || window.event;
    	var keycode = event.charCode || event.keyCode;
    	var overlapping = true;
    	var notOverlapping = false;
	   //Spacebar Horn
    	if(keycode == 32){
        	playSound(0, overlapping);
    	}
    	
    	  //A key does Aw Hell Naw
        if (keycode == 65){
            playSound(12, overlapping);
        }
    	
    	  //B key does Beeb
        if (keycode == 66){
            playSound(6, overlapping);
        }
        
        //D key triggers Drax
        if (keycode == 68){
            playSound(9, notOverlapping);
        }
        //E key That Was Easy
        if (keycode == 69){
            playSound(11, notOverlapping);
        }
        
    	//F key triggers Fire Gun/Gat
    	if(keycode == 70){
    		playSound(1, overlapping);
    	}

    	//G key triggers Giggity
    	if(keycode == 71){
    		playSound(15, overlapping);
    	}
    	
    	    	//H key triggers Hey Kid
    	if(keycode == 72){
    		playSound(13, notOverlapping);
    	}
    	
    	        //N key does not know De Wae
        if (keycode == 78){
            playSound(4, notOverlapping);
        }
        // O does Oh Yeah
                if (keycode == 79){
            playSound(7, notOverlapping);
        }
        
        // P does Pork Chop Sandwiches
        if(keycode == 80){
        playSound(14, notOverlapping);
        }
        
    	  //R key triggers Ricola
        if (keycode == 82){
            playSound(8, notOverlapping);
        }
        
    	  //S key triggers Damnson
        if (keycode == 83){
            playSound(10, notOverlapping);
        }
        //T key triggers TD4W
        if (keycode == 84){
            playSound(2, notOverlapping);
        }

        //Y key does Yas
        if (keycode == 89){
            playSound(5, overlapping);
        }
        
        //? or / 191
        if (keycode == 191){
            playRandomSound( overlapping );
        }
         
}

